import React from 'react';

const NumPad = () => {
  const keys1 = ["7", "8", "9"];
  const keys2 = ["4", "5", "6"];
  const keys3 = ["1", "2", "3"];
  const keys4 = ["0", "ENTER"];

  return (
    <div className='keyboard'>
      <div className='numLine1'>
        {keys1.map((key) => (
          <div key={key}>{key}</div>
        ))}
      </div>
      <div className='numLine'>
        {keys2.map((key) => (
          <div key={key}>{key}</div>
        ))}
      </div>
      <div className='numLine'>
        {keys3.map((key) => (
          <div key={key}>{key}</div>
        ))}
      </div>
      <div className='zeroLine'>
        {keys4.map((key) => (
          <div key={key}>{key}</div>
        ))}
      </div>
    </div>
  );
};

export default NumPad;
